import "./Navbar.css";
import Logo from '../assets/logo.png'

const Navbar = () => {

    return(
        <>
        <div id="main_navbar">
            <div id="main_nav_left">
                <img src={Logo} alt="Sage cage and grills logo"/>
            </div>

            <div id="main_nav_right">
                <p>Home</p>
                <p>About us</p>
                <p>Contact</p>
                <p>Franchise</p>
            </div>
        </div>
        </>
    );
}

export default Navbar;
